import React from "react";
import { NavLink } from "react-router-dom";

const Header = props => {
  return (
  <div>
    <section className="page-section mb-0" id="header">
        <div className="container">
            <h2 className="page-section-heading text-center">Welcome to your girl gang in STEM</h2>
        </div>
    </section>
  </div>
  );
};

export default Header;
